import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import SignUp from './pages/SignUp';
import SignIn from './pages/SignIn';
import About from './pages/About';
import OrderDrive from './pages/OrderDrive';
import LogOut from './pages/LogOut';
import MyComp from './pages/MyComp';
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">Shabetz-Vesa</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Router>
        <Routes>
          <Route path='/' exact element={<HomePage></HomePage>} />
          <Route path='/SignIn' element={<SignIn></SignIn>} />
          <Route path='/SignUp' element={<SignUp></SignUp>} />
          <Route path='/About' element={<About></About>} />
          <Route path='/OrderDrive' element={<OrderDrive></OrderDrive>} />
          <Route path='/LogOut' element={<LogOut></LogOut>} />
          <Route path='/MyComp' element={<MyComp></MyComp>} />
        </Routes>
      </Router>
    </div>
  );
}


export default App;
